import axios from "axios"
import React,{ useEffect, useState } from "react";
import './static/Projects.css'

const Projects = (props)=>{
    const [Data,SetData] = useState([]);
    async function fetchProduct(){
        const response = await axios.get("http://localhost:5000/view/view_product");
        SetData(response.data)
    }
    useEffect(()=>{
        fetchProduct()
    },[])
    const Projects = Data.filter((item)=>(item.category==="Django"))
    return(
        <>
        <ul>
            {props.Categories.map((cat)=>(
                <li key={cat._id}>
                    {cat.category}
                </li>))}
        </ul>
        <table>
            <tr>
                <th>Title</th><th>Category</th><th>Sub Category</th><th>View</th>
            </tr>
            {props.Categories.map((categ)=>
                Projects.map((project)=>(<tbody>
            <tr key={project._id}>
            <td>{project.title}</td>
            <td>{project.category}</td>
            <td>{project.sub_category}</td>
            <td>View</td>
            </tr>
            </tbody>)))}
        </table>
        </>
    )
}
export default Projects;
